I also noted that a lot of Open() and GetNext() implementations have similar preambles, e.g. 

  SCOPED_TIMER(runtime_profile_->total_time_counter());
  ScopedGetNextEventAdder ea(this, eos);
  DCHECK(row_batch != NULL);
  RETURN_IF_ERROR(ExecDebugAction(TExecNodePhase::GETNEXT, state));
  RETURN_IF_CANCELLED(state);
  RETURN_IF_ERROR(QueryMaintenance(state));

Some leave parts of those out, though it's not clear whether that happens on purpose. Should we file a follow-up Jira to unify the preambles, possibly with some generic macro?

